import React from 'react';

type ButtonType = {
    onClick: ()=> void
    title: string
    color: string
    children?: React.ReactNode
}

const Button:React.FC = (props: ButtonType) => {


    return (
        <div>
            <button onClick={props.onClick}>{props.title}</button>
        </div>
    );
};

export default Button;
